import Song from "./Song";

const Tracks = ({ spotifySelectedPlaylist, spotifyPlaylistTracks, chooseTrack, youtubePlaylistTracks }) => {
	if (!spotifySelectedPlaylist) {
		return (
			<div className="tracks">
				{/* <div className="playlistHeaders-spotify">
					<h3>Spotify Playlist</h3>
				</div>
				<div className="playlistHeaders-youtube">
					<h3>Youtube Playlist</h3>
				</div> */}
			</div>
		);
	}

	return (
		<div className="tracks">
			<div className="playlistHeaders-spotify">
				<h3>{spotifySelectedPlaylist.name}</h3>
			</div>
			<div className="tracks-content">
				{spotifyPlaylistTracks.length > 0}
				<ul>
					{spotifyPlaylistTracks.map((playlistTrack) => {
						const track = playlistTrack.track;
						return <Song chooseTrack={chooseTrack} track={track} />;
					})}
				</ul>
			</div>

			<div className="playlistHeaders-youtube">
				<h3>Youtube Playlist</h3>
				<div className="tracks-content">
					{youtubePlaylistTracks.length > 0}
					<ul>
						{youtubePlaylistTracks.map((youtubePlaylistTrack) => {
							// const track = playlistTrack.track;
							return <p>{youtubePlaylistTrack.name}</p>;
							// return <Song chooseTrack={chooseTrack} track={track} />;
						})}
					</ul>
				</div>
			</div>
		</div>
	);
};

export default Tracks;
